import React from "react";
// import Loading from "./Loading";
import Tours from "./Tours";
import { data } from "./Data";

function App() {
  const removeTour = (id) => {
    data.filter((tour) => tour.id !== id);

    return (
      <main>
        <div className="title">
          <h2>no tours left</h2>
          <button className="btn" onClick={() => Tours()}>
            refresh
          </button>
        </div>
      </main>
    );
  };

  return (
    <main>
      <Tours removeTour={removeTour} />
    </main>
  );
}

export default App;
